import React from 'react';
import {motion} from "framer-motion"

export default function Pin({ url, key }) {
  return (
    <motion.div
    initial={{ scale: 0 }}
  animate={{ rotate: 180, scale: 1 }}
  transition={{
    type: "spring",
    stiffness: 260,
    damping: 20
  }}
    >
      <img src={url} key={key} alt="" className="pin" />
    </motion.div>
  );
}
